import Vue from 'vue';
import Router from 'vue-router';
import Home from '../views/Home.vue';
import About from '../views/About.vue';
import InmueblesView from '../views/Inmuebles.vue'; // Asegúrate de que el nombre coincida

Vue.use(Router);

export default new Router({
  routes: [
    {
      path: '/',
      name: 'Home',
      component: Home
    },
    {
      path: '/about',
      name: 'About',
      component: About
    },
    {
      path: '/inmuebles',
      name: 'Inmuebles',
      component: InmueblesView
    }
  ]
});
